// Init
let candle = record.current
let len = 10
let lenFast = 23
let lenSlow = 50
let factor = 0.5

// MACD
let fastEMA = calculateEMA(lenFast, candle.close, variable.fastEMAprev)
variable.fastEMAprev = fastEMA

let slowEMA = calculateEMA(lenSlow, candle.close, variable.slowEMAprev)
variable.slowEMAprev = slowEMA

let macd = fastEMA - slowEMA
variable.macdArray.push(macd)
if (variable.macdArray.length > len) { variable.macdArray.splice(0, 1) }


// STC
let v1 = Math.min(...variable.macdArray)
let v2 = Math.max(...variable.macdArray) - v1

let f1 = 0
if (v2 > 0) {
	f1 = (macd - v1) / v2 * 100
}

let pf = variable.pfPrev + (factor * (f1 - variable.pfPrev))
variable.pfPrev = pf
variable.pfArray.push(pf)
if (variable.pfArray.length > len) { variable.pfArray.splice(0, 1) }

let v3 = Math.min(...variable.pfArray)
let v4 = Math.max(...variable.pfArray) - v3

let f2 = 0
if (v4 > 0) {
	f2 = (pf - v3) / v4 * 100
}

variable.STC = variable.prevSTC + (factor * (f2 - variable.prevSTC))
variable.prevSTC = variable.STC


// NaN -> 0
variable.STC = variable.STC || 0

// FUNCTION
// EMA calculations
function calculateEMA(periods, price, previousEMA) {
	let k = 2 / (periods + 1)
	return price * k + previousEMA * (1 - k)
}
